import React from "react";
import {StoreType} from "../../redux/state";
import {Profile} from "./Profile";

type ProfilePropsType = {
    store: StoreType
}

class ProfileContainer extends React.Component  {

    render() {
        return (
            <div>
                <Profile {...this.props}/>
            </div>
        )
    }

}

export default ProfileContainer;
